import React from "react";
import SearchForecast from "./SearchForecast";
import ThreeDaysForecast from "./ThreeDaysForecast";

export default class Location extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h1 style={{ color: "red" }}>Location component</h1>
        <h2 style={{ color: "red" }}>{this.props.city}</h2>
        <SearchForecast city={this.props.city} style={{ color: "red" }} />
        <ThreeDaysForecast />
      </React.Fragment>
    );
  }
}
